import React from 'react';

import { Audio } from  'react-loader-spinner'

const AudioLoad = () => {
    return (
        <Audio
    height = "80"
    width = "80"
    radius = "9"
    color = 'while'
    ariaLabel = 'three-dots-loading'     
    wrapperStyle
    wrapperClass
  />
    );
}

export default AudioLoad;
